// Courtesy of StackOverflow, I'm too lazy to implement truncation
// which should be in the std library anyways
function truncateDecimals (num, digits)  {
    var numS = num.toString();
    var decPos = numS.indexOf('.');
    var substrLength = decPos == -1 ? numS.length : 1 + decPos + digits;
    var trimmedResult = numS.substr(0, substrLength);
    var finalResult = isNaN(trimmedResult) ? 0 : trimmedResult;

    // adds leading zeros to the right
    if (decPos != -1){
        var s = trimmedResult+"";
        decPos = s.indexOf('.');
        var decLength = s.length - decPos;

            while (decLength <= digits){
                s = s + "0";
                decPos = s.indexOf('.');
                decLength = s.length - decPos;
                substrLength = decPos == -1 ? s.length : 1 + decPos + digits;
            };
        finalResult = s;
    }
    return finalResult;
};

jQuery(document).ready(function() {
	$(".progress_bar_content").each(function(){
		var job_id = $(this).data("job-id");
		var bar = $(this);
		var stat = $("#progress-status-" + job_id);
		var banner = $("#job-banner-" + job_id);
		var percent_span = $('#progress-percent-' + job_id);
		var interval = setInterval(function(){
			$.ajax({
				url: '/progress-job/' + job_id,
				success: function(job){
					if (job == "none") {
						if (stat) {
							stat.html(I18n.t("jobs.ok"));
						}
						if (banner) {
							banner.removeClass();
							banner.addClass("status_tag");
							banner.addClass("ok");
							banner.html(I18n.t("finished"));
						}
					
						percent_span.html("100%");
						bar.css('width', '100%');
						clearInterval(interval);
						return;
					}
					
					// Valid job
					var stage, progress;

					if (job.progress_stage != null){
						stage = job.progress_stage;
						
						if (job.progress_current != null && job.progress_current > -1) {
							progress = job.progress_current / job.progress_max * 100;
							bar.css('width', progress + '%');
							percent_span.html(truncateDecimals(progress, 1) + "%");
							bar.removeClass('progress-bar-striped');
							bar.removeClass('active');
						} else {
							// If the progress is NULL OR it is indefinite
							// put the bar to indefinite
							bar.css('width','0%');
						}
					
						// Set the banner to running
						banner.removeClass();
						banner.addClass("status_tag");
						banner.addClass("yes");
						banner.html(I18n.t("running"));
					} else {
						stage = "Job enqueued"
						
						// Set the banner to waiting
						banner.removeClass();
						banner.addClass("status_tag");
						banner.addClass("no");
						banner.html(I18n.t("waiting"));
						
						// put the progressbar to indefinite
						bar.css('width','0%');
						percent_span.html("0.0%");
					}
					
					// Always update the stage
					if (stat) {
						stat.html(stage);
					}
					
					// If there are errors
					if (job.last_error != null) {
						
						if (!job.progress_stage) {
							stage = I18n.t("jobs.not_set")
						}
						
						stat.addClass("error");
						if (stat) {
							stat.html(I18n.t("jobs.error") + stage);
						}
						
						if (banner) {
							banner.removeClass();
							banner.addClass("status_tag");
							banner.addClass("error");
							banner.html(I18n.t("failed"));
						}
						
						clearInterval(interval);
						return;
					}

				},
				error: function(){
					if (stat) {
						stat.html(I18n.t("jobs.no_status"));
					}
					if (banner) {
						banner.removeClass();
						banner.addClass("status_tag");
						banner.addClass("error");
						banner.html('Error');
					}
					clearInterval(interval);
				}
			})

		},1000);
	});
});
/*

	Workaround for custom-defined ransak filters, as they do not show
	in the text box after filtering.
	It requires on each page a div filter_workaround, with the params[] data
	from rails. This is necessary because params will contain the filters
	restored in config.before_action :restore_search_filters
	so the saved string is persistent.
	See the ActiveAdmin bug here:
	https://github.com/activeadmin/activeadmin/issues/4554
	https://github.com/activeadmin/activeadmin/issues/3510
	
*/


var activeadmin_filter_workaround = function () {

	if ($("#filter_workaround").length == 0) {
		// no partial
		//console.log("No #filter_workaround div");
		return;
	}

	var params = JSON.parse($("#filter_workaround").attr("data-params"));
	var queries = {};
	
	if (!("q" in params) || !params) {
		return;
	}
	
	for (var key in params["q"]) {
		queries["q_" + key] = params["q"][key];
	}
	console.log(queries);
	
	if (queries) {
		$("[id^=q_]").each(function(){
			var input_name = $(this).attr("id");
			if (input_name in queries) {
				
				if ($(this).val() == "" && queries[input_name] != "") {
					$(this).val(queries[input_name]);
					console.log("Filter bush fix: added value " + queries[input_name] +
					" to filter " + input_name);
				}
				
			}
		});
	}
};

$(document).ready(activeadmin_filter_workaround);
// Fix for turbolinks: it will not call againg document.ready
$(document).on('page:load', activeadmin_filter_workaround);
var show_viaf_actions = function () {
  var $viaf_table = $("#viaf_table");

  $("#viaf-sidebar").click(function(){
    marc_editor_show_panel("viaf-form");
    $('#viaf-form').children('div.tab_panel').show();
  });

  $viaf_table.on('click', '.data', function() {
    _update_form($(this).data("viaf"));
    marc_editor_show_panel("marc_editor_panel");
  });

  /**
  * Update form following these rules:
  * if tag in protected fields: only update if new
  * else: add other tags (new and append)
  * never update fields if not new
  */
  function _update_form(data){
    protected_fields = ['100']
    tags = data["fields"]
    tag = ""
    cnt = 0
    for(t=0; t < tags.length; t++){
      datafield = tags[t]
      if(datafield.tag != tag){
        cnt = 0
        tag = datafield.tag
      }
      else{
        cnt++
      }
      if (!($.inArray(datafield.tag, protected_fields))){
        if (/\/new#$/.test(self.location.href)){
          _update_marc_tag(datafield.tag, marc_json_get_tags(data, datafield.tag)[cnt])
        }
        else{
          continue
        }
        continue
      }
      if (_size_of_marc_tag(datafield.tag) == 0){
        _new_marc_tag(datafield.tag, marc_json_get_tags(data, datafield.tag)[cnt])
      }
      else{
        if (_marc_tag_is_empty(datafield.tag)){
          _update_marc_tag(datafield.tag, marc_json_get_tags(data, datafield.tag)[cnt])
        }
        else{
          _append_marc_tag(datafield.tag, marc_json_get_tags(data, datafield.tag)[cnt])
        }
      }
    }
  }

  function searchViaf(){
    $viaf_table.html("");
    var term = $("#viaf_input").val();
    var model = $("#marc_editor_panel").attr("data-editor-model");
      $.ajax({
        type: "GET",
        url: "/admin/"+model+"/viaf.json?viaf_input="+term,
        beforeSend: function() { 
          $('#loader').show();
        },
        complete: function(){
          $('#loader').hide();
        },
        error: function(jqXHR, textStatus, errorThrown) {
          alert(jqXHR.responseText);
        },
        success: function(data){
          var result = (JSON.stringify(data));
          drawTable(data);
        }
      });
  }

  $("#viaf_button").click(function(){ 
    searchViaf()
  })

  $('#viaf_input').keydown(function (e) {
    var keyCode = e.keyCode || e.which;
    if (keyCode == 13) { 
      searchViaf()
    }
  });

  function drawTable(data) {
    for (var i = 0; i < data.length; i++) {
      drawRow(data[i]);
    }
  }

  function drawRow(rowData) {
    locale = $viaf_table.attr("locale")
    message = {"de": "übernehmen", "en": "select", "fr": "choisir", "it": "scegliere"}[locale]
    var id = marc_json_get_tags(rowData, "001")[0].content;
    var tag100 = marc_json_get_tags(rowData, "100")[0]
    var tag24 = marc_json_get_tags(rowData, "024")[1]
    var model = $("#marc_editor_panel").attr("data-editor-model");
    var row = $("<tr />")
    $viaf_table.append(row); 
    row.append($("<td><a target=\"_blank\" href=\"http://viaf.org/viaf/" + id + "\">" + id + "</a></td>"));
    row.append($("<td>" + tag100["a"] + "</td>"));
    if(model=="works"){
      row.append($("<td>" + (tag100["t"] ? tag100["t"] : "") + "</td>"));
    }
    else{
      row.append($("<td>" + (tag100["d"] ? tag100["d"] : "") + "</td>"));
    }
    row.append($("<td>" + ( (typeof(tag24)!='undefined') ? tag24["2"] : "") + "</td>"));
    row.append($('<td><a class="data" id="viaf_data" href="#" data-viaf=\'' + JSON.stringify(rowData) + '\'>' + message  + '</a></td>'));
  }
};

function _update_marc_tag(target, data) {
  block = $(".marc_editor_tag_block[data-tag='" + target + "']")
  var model = $("#marc_editor_panel").attr("data-editor-model");
  for (code in data){
    subfield = block.find(".subfield_entry[data-tag='" + target + "'][data-subfield='" + code + "']").first()
    if (model == "works" && target == "100" && code == "a") {
      subfield = $("#100a");
    }
    if (model == "works" && target == "100" && code == "0") {
      subfield = $("input[data-tag='100'][data-subfield='0']");
    }
    subfield.val(data[code]);
    subfield.css("background-color", "#ffffb3");
  }
}

function _new_marc_tag(target, data) {
  field = $(".tag_placeholders[data-tag='"+ target +"']")
  placeholder = field.parents(".tag_group").children(".tag_placeholders_toplevel").children(".tag_placeholders")
  parent_dl = field.parents(".tag_group").children(".marc_editor_tag_block");
  new_dt = placeholder.clone();
  for (code in data){
    subfield = new_dt.find(".subfield_entry[data-tag='" + target + "'][data-subfield='" + code + "'],.serialize_marc[data-tag='" + target + "'][data-subfield='" + code + "'], .marc_editor_hotkey[data-field='" + target + "'][data-subfield='" + code + "']").first()
    subfield.val(data[code]);
    subfield.css("background-color", "#ffffb3"); 
  }
  new_dt.toggleClass('tag_placeholders tag_toplevel_container');
  parent_dl.append(new_dt);
  new_dt.show();
  new_dt.parents(".tag_group").children(".tag_empty_container").hide();
}

function _append_marc_tag(target, data) {
  block = $(".marc_editor_tag_block[data-tag='" + target + "']")
  placeholder = block.parents(".tag_group").children(".tag_placeholders_toplevel").children(".tag_placeholders");
  new_dt = placeholder.clone()
  for (code in data){
    subfield = new_dt.find(".subfield_entry[data-tag='" + target + "'][data-subfield='" + code + "'],.serialize_marc[data-tag='" + target + "'][data-subfield='" + code + "'], .marc_editor_hotkey[data-field='" + target + "'][data-subfield='" + code + "']").first()
    subfield.val(data[code]);
    subfield.css("background-color", "#ffffb3");
  }
  new_dt.toggleClass('tag_placeholders tag_toplevel_container');
  block.append(new_dt)
  new_dt.show()
}

function _size_of_marc_tag(tag){
  fields = $(".tag_toplevel_container[data-tag='"+ tag +"']")
  return fields.length
}

function _marc_tag_is_empty(tag){
  block = $(".marc_editor_tag_block[data-tag='" + tag + "']")
  subfields = block.find("input.subfield_entry[data-tag='" + tag + "']")
  for (var i = 0; i < subfields.length; i++){
    if (subfields[i].value!=""){
      return false
    }
  }
  return true
}

